INSERT INTO `questions` (`id`, `session1`, `department`, `level`, `semester`, `course`, `exam_type`, `exam_mode`, `exam_category`, `no_of_qst`, `upload_no_of_qst`, `question_type`, `question_no`, `question`, `answer`, `graphic`, `created_at`, `updated_at`) VALUES
(1, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 1, '<p>What is the causative agent of tuberculosis?<br />\r\na) Virus<br />\r\nb) Bacteria<br />\r\nc) Fungus<br />\r\nd) Protozoa</p>', 'B', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:34:51'),
(2, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 2, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following diseases is caused by the Human Immunodeficiency Virus (HIV)?<br />\n   a) Tuberculosis<br />\n   b) Malaria<br />\n   c) Hepatitis B<br />\n   d) AIDS<br />\n</p>', 'D', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(3, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 3, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following is NOT a vector-borne disease?<br />\n   a) Malaria<br />\n   b) Dengue Fever<br />\n   c) Tuberculosis<br />\n   d) Zika Virus<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(4, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 4, '<p style=\"font-size: 24px; font-family: Arial;\">What is the primary mode of transmission of Hepatitis B?<br />\n   a) Sexual contact<br />\n   b) Airborne<br />\n   c) Contaminated food and water<br />\n   d) Vector-borne<br />\n</p>', 'A', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(5, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 5, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following is a vaccine-preventable disease?<br />\n   a) Cholera<br />\n   b) Measles<br />\n   c) Dengue Fever<br />\n   d) Typhoid<br />\n</p>', 'B', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(6, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 6, '<p style=\"font-size: 24px; font-family: Arial;\">What is the causative agent of Malaria?<br />\n   a) Plasmodium virus<br />\n   b) Anopheles mosquito<br />\n   c) Plasmodium parasite<br />\n   d) Plasmodium bacteria<br />\n</p>', 'D', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(7, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 7, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following diseases is transmitted through contaminated food and water?<br />\n   a) Tuberculosis<br />\n   b) Cholera<br />\n   c) Dengue Fever<br />\n   d) HIV/AIDS<br />\n</p>', 'B', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(8, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 8, '<p style=\"font-size: 24px; font-family: Arial;\">What is the primary mode of transmission of Dengue Fever?<br />\n   a) Vector-borne<br />\n   b) Sexual contact<br />\n   c) Airborne<br />\n   d) Direct contact with infected blood<br />\n</p>', 'A', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(9, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 9, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following diseases is caused by a virus?<br />\n   a) Cholera<br />\n   b) Tuberculosis<br />\n   c) Influenza<br />\n   d) Tetanus<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(10, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 10, '<p style=\"font-size: 24px; font-family: Arial;\">What is the incubation period of Hepatitis A?<br />\n    a) 1-2 days<br />\n    b) 1-2 weeks<br />\n    c) 1-2 months<br />\n    d) 1-2 years<br />\n</p>', 'D', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(11, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 11, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following is NOT a symptom of Tuberculosis?<br />\n    a) Persistent cough<br />\n    b) Fever<br />\n    c) Rash<br />\n    d) Weight loss<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(12, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 12, '<p style=\"font-size: 24px; font-family: Arial;\">How is Ebola primarily transmitted?<br />\n    a) Airborne<br />\n    b) Vector-borne<br />\n    c) Direct contact with bodily fluids<br />\n    d) Contaminated food and water<br />\n</p>', 'D', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(13, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 13, '<p style=\"font-size: 24px; font-family: Arial;\">What is the primary vector for the transmission of Zika Virus?<br />\n    a) Aedes mosquito<br />\n    b) Anopheles mosquito<br />\n    c) Culex mosquito<br />\n    d) Tsetse fly<br />\n</p>', 'A', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(14, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 14, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following diseases is NOT caused by a virus?<br />\n    a) Influenza<br />\n    b) Dengue Fever<br />\n    c) Tuberculosis<br />\n    d) HIV/AIDS<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(15, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 15, '<p style=\"font-size: 24px; font-family: Arial;\">What is the causative agent of Chikungunya Fever?<br />\n    a) Virus<br />\n    b) Bacteria<br />\n    c) Protozoa<br />\n    d) Fungus<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(16, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 16, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following diseases is transmitted through contaminated needles?<br />\n    a) Tetanus<br />\n    b) Malaria<br />\n    c) Hepatitis C<br />\n    d) Dengue Fever<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(17, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 17, '<p style=\"font-size: 24px; font-family: Arial;\">What is the primary mode of transmission of Typhoid Fever?<br />\n    a) Sexual contact<br />\n    b) Airborne<br />\n    c) Contaminated food and water<br />\n    d) Vector-borne<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(18, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 18, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following is a symptom of Rabies?<br />\n    a) Rash<br />\n    b) Fever<br />\n    c) Hydrophobia<br />\n    d) Joint pain<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(19, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 19, '<p style=\"font-size: 24px; font-family: Arial;\">What is the causative agent of Yellow Fever?<br />\n    a) Bacteria<br />\n    b) Virus<br />\n    c) Protozoa<br />\n    d) Fungus<br />\n</p>', 'B', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(20, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 20, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following diseases is caused by a protozoan parasite?<br />\n    a) Malaria<br />\n    b) Influenza<br />\n    c) Dengue Fever<br />\n    d) Typhoid Fever<br />\n</p>', 'A', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(21, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 21, '<p style=\"font-size: 24px; font-family: Arial;\">What is the primary mode of transmission of Leprosy?<br />\n    a) Airborne<br />\n    b) Vector-borne<br />\n    c) Direct contact<br />\n    d) Sexual contact<br />\n</p>', 'C', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
(22, '2024/2025', 'Diploma in Community Health(CHEW)', '100', 'First', 'PREPARATORY', 'PREPARATORY', 'OBJECTIVE', 'GENERAL', 50, 50, 'text', 22, '<p style=\"font-size: 24px; font-family: Arial;\">Which of the following diseases is NOT vaccine-preventable?<br />\n    a) Measles<br />\n    b) Tuberculosis<br />\n    c) Polio<br />\n    d) Tetanus<br />\n</p>', 'B', 'blank.jpg', '2024-06-11 02:02:26', '2024-06-11 02:02:26'),
